import React from 'react';

const Track = (props) => {
    const { track } = props;

    return (
        <div className="col-md-6">
            <div className="card mb-4 shadow-sm">
                <div className ="card-body">
                    <p className="card-text">

                        <strong><i className="fas fa-play"> Track</i></strong>: {track} by <h6>{props.artist}</h6>
                    </p>
                    <img src={props.cover} width='150'></img>

                </div>
            </div>

        </div>
    )
}
export default Track;
